function googlemap(){
    var axios = require('axios');

    const startName = tronto;
    const destinationName = montreal;

    var config = {
    method: 'get',
    url: `https://maps.googleapis.com/maps/api/directions/json?origin=${startName}&destination=${destinationName}&mode=transit&departure_time=1343641500&key=AIzaSyAyZffxPv5S2NP2NEp_31-HH9XmDwSEWbM`,
    headers: { }
    };

    axios(config)
    .then(function (response) {
    console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
    console.log(error);
    });
  }
